    YOW += y[10]*imw[10]; /*CH2 */
    YOW += y[11]*imw[11]; /*CH2(S) */
    YOW += y[12]*imw[12]; /*CH3 */
    YOW += y[13]*imw[13]; /*CH4 */
    YOW += y[14]*imw[14]; /*CO */
    YOW += y[15]*imw[15]; /*CO2 */
    YOW += y[16]*imw[16]; /*HCO */
