    YOW += y[24]*imw[24]; /*C2H4 */
    YOW += y[25]*imw[25]; /*C2H5 */
    YOW += y[26]*imw[26]; /*C2H6 */
    YOW += y[27]*imw[27]; /*HCCO */
    YOW += y[28]*imw[28]; /*CH2CO */
