    J[1129] += dqdci;             /* dwdot[CH4]/d[C3H7] */
    J[1147] += dqdci;             /* dwdot[C3H7]/d[C3H7] */
    J[1148] -= dqdci;             /* dwdot[C3H8]/d[C3H7] */
    /* d()/d[C3H8] */
    dqdci =  + k_f*sc[12];
    J[1164] -= dqdci;             /* dwdot[CH3]/d[C3H8] */
    J[1165] += dqdci;             /* dwdot[CH4]/d[C3H8] */
