    J[917] += dqdci;              /* dwdot[CH2O]/d[C2H5] */
    J[925] += dqdci;              /* dwdot[C2H5]/d[C2H5] */
    J[931] -= dqdci;              /* dwdot[C3H7]/d[C2H5] */
    /* d()/d[C3H7] */
    dqdci =  + k_f*sc[2];
    J[1118] -= dqdci;             /* dwdot[O]/d[C3H7] */
    J[1133] += dqdci;             /* dwdot[CH2O]/d[C3H7] */
