    J[1120] -= dqdci;             /* dwdot[OH]/d[C3H7] */
    J[1134] += dqdci;             /* dwdot[CH2OH]/d[C3H7] */
    J[1141] += dqdci;             /* dwdot[C2H5]/d[C3H7] */
